"use strict";

import React from "react";
import { Outlet } from "react-router-dom";

import Header from "../components/page_home/header";
import Navbar from "../components/navbar";
import Main from "../components/page_home/main";

function Home() {
    return (
        <div className="home bg-black">
            <Header>
                <Navbar/>
                <Main/>
                <Outlet/>
            </Header>
        </div>
    )
}

export default Home;
